import './item.css'
function ReasonPopUp(props) {
  return (
<div>
{props.rejectPopUpRender && (
        <div className="iconVideo">
          <div className="VideoBox">
            <div className="d-flex justify-content-between p-3 pb-0">
             <p>Contact</p>

              <button
                type="button"
                className="btn-close"
                aria-label="Close"
                // onClick={(e) => props.SetrenderContact(!props.renderContact)}
              ></button>
            </div>
            <hr
              style={{
                width: "93%",
                height: "2px",
                margin: "auto",
                color: "#2558FF",
              }}
            />
            <div>

                <p className="p-3 pb-1 pt-4">
                  საგარეო ვაჭრობისა და უცხოური ინვესტიციების სტატისტიკის
                  დეპარტამენტი
                </p>


                <p className="p-3 pb-1 pt-4">E-mail: info@geostat.ge</p>


                <p className="p-3 pb-1 pt-4">Phone: (+995 32) 236 72 10 </p>

            </div>
          </div>
        </div>
      )}
    </div>

  );
}
export default ReasonPopUp;
